import React from 'react';
import './first.css';

function First() {
 return (
    <div className="App">
      <h1>What is Puppy Culture?</h1>
      <img src=''/>
      <p>On the top level, Puppy Culture is a socialization and training program specifically developed for puppies, from birth through the end of their critical socialization period. It includes age appropriate protocols and lessons laid out in an organized format. The program consists of videos, books and a Workbook, but that really does not get to the "why" of Puppy Culture, or what makes it differ.</p>
    </div>
 );
}

export default First;
